// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Token is ERC20 {
    uint256 public transactionFeePercentage; // Fee percentage on transfers
    uint256 public burnPercentage; // Percentage of transfer amount to burn
    address public treasury; // Address to receive transaction fees

    event ParametersUpdated(uint256 feePercentage, uint256 burnPercentage, address treasury);

    constructor() ERC20("Hyperia", "HYP") {
        uint256 totalSupply = 4_000_000_000 * (10 ** decimals());
        _mint(msg.sender, totalSupply); // Mint total supply to deployer
        transactionFeePercentage = 2; // Default transaction fee (2%)
        burnPercentage = 1; // Default burn percentage (1%)
        treasury = msg.sender; // Default treasury is deployer
    }

    function updateParameters(uint256 _transactionFeePercentage, uint256 _burnPercentage, address _treasury) external {
        require(_transactionFeePercentage <= 10, "Fee too high");
        require(_burnPercentage <= 10, "Burn too high");
        require(_treasury != address(0), "Invalid treasury address");

        transactionFeePercentage = _transactionFeePercentage;
        burnPercentage = _burnPercentage;
        treasury = _treasury;

        emit ParametersUpdated(_transactionFeePercentage, _burnPercentage, _treasury);
    }

    function _transfer(address sender, address recipient, uint256 amount) internal override {
        uint256 feeAmount = (amount * transactionFeePercentage) / 100;
        uint256 burnAmount = (amount * burnPercentage) / 100;
        uint256 transferAmount = amount - feeAmount - burnAmount;

        if (feeAmount > 0) {
            super._transfer(sender, treasury, feeAmount); // Send fees to treasury
        }
        if (burnAmount > 0) {
            _burn(sender, burnAmount); // Burn tokens
        }
        super._transfer(sender, recipient, transferAmount); // Transfer remaining amount
    }

    function mint(address account, uint256 amount) external {
        _mint(account, amount);
    }

    function burn(address account, uint256 amount) external {
        _burn(account, amount);
    }
}
